import { motion } from "framer-motion";

const TypingEffect = () => {
  return (
    <motion.h1 
      className="text-4xl font-bold text-center text-black mt-10"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 2 }}
    >
      Welcome to LearnHyve!
    </motion.h1>
  );
};

export default TypingEffect;
